    false,nt"url": null,nt"notes": "This data set consists of digitized water-level
    elevation contours for the Enid isolated terrace aquifer in northwestern Oklahoma.
    The Enid isolated terrace aquifer covers approximately 82 square miles and supplies
    water for irrigation, domestic, municipal, and industrial use for the City of Enid
    and western Garfield County. The Quaternary-age Enid isolated terrace aquifer is
    composed of terrace deposits that consist of discontinuous layers of clay, sandy
    clay, sand, and gravel. The aquifer is unconfined and is bounded by the underlying
    Permian-age Hennessey Group on the east and the Cedar Hills Sandstone Formation
    of the Permian-age El Reno Group on the west. Cedar Hills Sandstone Formation fills
    a channel beneath the thickest section of the Enid isolated terrace aquifer in the
    midwestern part of the aquifer. The water-level elevation contours were digitized
    from a photocopy of a paper map in a ground-water modeling thesis and report. The
    map digitized was published at a scale of 1:62,500 shows that the ground-water elevations
    in 1973 ranged from about 1,360 feet above sea level at the northwestern edge to
    about 1,150 feet above sea level at the southeastern edge of the aquifer.",nt"owner_org":
